insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (68,10,97,0,2400,'Moccasin stitch lace up, removable cork/latex and hand-stitched Smartlite sole.'),(69,10,97,0,2401,'The Ponte Sor is sleek, black, and totally street. With leather uppers, a removable footbed providing arch and metatarsal support, and flexible rubber soles, the Ponte Sor offers athletic style (with four suede \"racing\" stripes and a red mesh tongue for a hint of contrast) with a casual fit.'),(70,10,97,0,2402,'A men\'s sporty, lace-up sneaker.  Has Footprints removable and anatomically contoured footbed.  Suede upper is breathable, durable and comfortable.  Take a step into comfort you won\'t forget!'),(71,10,97,0,2403,'A men\'s sporty, lace-up sneaker.  Has Footprints removable and anatomically contoured footbed.  Suede upper is breathable, durable and comfortable.  Take a step into comfort you won\'t forget!'),(72,10,97,0,2404,'A men\'s sporty, lace-up sneaker with a removable contoured footbed.');
