insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (96,10,97,0,2428,'A slick and stylish women\'s sport shoe in rich brown suede.  Top stitching adds interest.  Has a removable cork/latex footbed and a shock absorbing low profile rubber sole.'),(97,10,97,0,2429,'An urban twist on classic styling. This Mary Jane style is adjustable and has a metal shank for added stability. We offer the Scarlet lined with cambrelle for its wicking and antimicrobial benefits and the black with traditional pigskin. Built on our fluid outsole.'),(98,10,97,0,2430,'A casual slip on with contrasting stitching and double goring for adjustability. Also has a hidden internal collar padding, metal shank for added stability, and fluid outsole. Lined with cambrelle for wicking and antimicrobial benefits.'),(99,10,97,0,2431,'An elegant suede ankle-length boot for the discriminating taste.  Lined with Carnival, a Synthetic Liner that allows the feet to breath while providing warmth and wicking ability. Outsoul is made of dense, rugged rubber tread for excellent traction, gripping and long wear. Removable Natural Cork/Latex footbed.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (100,10,97,0,2432,'Enjoy your walk and let Footprints take care of your feet with this casual light hiker, great for day hikes on the trail or around town. Removable cork/latex footbed, rust-proof eyelets and oxford lacing. Features dense rubber tread to ensure excellent traction and long wear, and a synthetic shank made of Bergamid nylon for added stability.'),(101,10,97,0,2433,'Enjoy your walk and let Footprints take care of your feet with this casual light hiker, great for day hikes on the trail or around town. Removable cork/latex footbed, rust-proof eyelets and oxford lacing. Features dense rubber tread to ensure excellent traction and long wear, and a synthetic shank made of Bergamid nylon for added stability.'),(102,10,97,0,2434,'Rugged ankle-high hiking boot with removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, a dense rubber tread to ensure excellent traction and long wear, and a synthetic shank for added stability. The synthetic shank is made of Bergamid, a type of nylon.'),(103,10,97,0,2435,'Rugged ankle-high hiking boot with removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, a dense rubber tread to ensure excellent traction and long wear, and a synthetic shank for added stability. The synthetic shank is made of Bergamid, a type of nylon.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (104,10,97,0,2436,'Rugged and waterproof high-top hiking boot for maximum ankle support. Features removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, and dense rubber tread to ensure excellent traction and long wear. Made with Sympatex, a waterproof, breathable material that keeps feet dry while allowing moisture from perspiration to pass through. Also has a metal shank for added stability.'),(105,10,97,0,2437,'Rugged and waterproof high-top hiking boot for maximum ankle support. Features removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, and dense rubber tread to ensure excellent traction and long wear. Made with Sympatex, a waterproof, breathable material that keeps feet dry while allowing moisture from perspiration to pass through. Also has a metal shank for added stability.'),(106,10,97,0,2438,'Rugged and waterproof high-top hiking boot for maximum ankle support. Features removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, and dense rubber tread to ensure excellent traction and long wear. Made with Sympatex, a waterproof, breathable material that keeps feet dry while allowing moisture from perspiration to pass through. Also has a synthetic shank for added stability, made of Bergamid, a type of nylon.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (107,10,97,0,2439,'Rugged and waterproof high-top hiking boot for maximum ankle support. Features removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, and dense rubber tread to ensure excellent traction and long wear. Made with Sympatex, a waterproof, breathable material that keeps feet dry while allowing moisture from perspiration to pass through. Also has a synthetic shank for added stability, made of Bergamid, a type of nylon.'),(108,10,97,0,2440,'Euro-style professional shoe with a flexible cork/latex footbed and shock-absorbing sole. Polyurethane coated leather uppers are heat, cold, acid and chemical resistant. Velcro closures provide a custom fit.'),(109,10,97,0,2441,'Euro-style professional shoe with a flexible cork/latex footbed and shock-absorbing sole. Polyurethane coated leather uppers are heat, cold, acid and chemical resistant. Velcro closures provide a custom fit.'),(110,10,97,0,2442,'Professional clog with adjustable back and vamp straps on a sporty, polyurethane sole with deeper tread for improved traction. This clog offers a heel pad in the footbed and upper leather is coated with polyurethane to provide heat, cold, acid and chemical resistance.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (111,10,97,0,2443,'Professional clog with adjustable back and vamp straps on a sporty, polyurethane sole with deeper tread for improved traction. This clog offers a heel pad in the footbed and upper leather is coated with polyurethane to provide heat, cold, acid and chemical resistance.'),(112,10,97,0,2445,'The A604 from Alpro is a Steel Toe Polyurethane Clog with a removable, replaceable cork footbed. The sole has a deeper tread for improved traction and the Steel Toe passed ANSI Z 41 1999 standards for Class I/75 impact and Class C/75 compression classification.'),(113,10,97,0,2446,'Our most popular style, providing long term comfort and arch support to any casual, flat footwear. Contoured arches and deep heel cup can help relieve heel pain and plantar fasciitis symptoms. Like the Heeled Blue Footbed, it has a silk lining that absorbs moisture and is hand-washable. Casual Blue Footbed is available in narrow, medium and wide widths. \r\nCasual - For flat/low heeled footwear.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (114,10,97,0,2447,'A popular style that provides long term comfort and arch support to any heeled footwear (up to 1\" heels). Contoured arches and deep heel cup can help relieve heel pain and plantar fasciitis symptoms. Similar to the Casual Blue Footbed, this heeled version has silk lining that absorbs moisture and is hand-washable. Heeled Blue Footbed is available in narrow, medium and wide widths. \r\nHeeled - For heeled footwear up to 1\".'),(115,10,97,0,2448,'Arch support with natural cork and EVA. It features a deep molded heel cup, pronounced medial arch support and moderate metatarsal support.\r\n\r\nSupports the medial arch - Can help with problems such as fallen arches and over-pronation.\r\nSupports the ball of the foot - Helps maintain the natural curvature necessary for optimal weight-bearing and transfer.\r\nProvides proper alignment - Balances foot impact areas. Can reduce fatigue and increase life of footwear. \r\nHigh Flanges - Increases stability. Helps control excessive pronation and/or supination.\r\nDeep Heel Cup - Cushions and protects the heel bone. Can relieve heel pain symptoms. Provides natural cushioning and shock absorption.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (116,10,97,0,2449,'Arch support with natural cork and EVA. It features a deep molded heel cup, pronounced medial arch support and moderate metatarsal support.\r\nSupports the medial arch - Can help with problems such as fallen arches and over-pronation.\r\nSupports the ball of the foot - Helps maintain the natural curvature necessary for optimal weight-bearing and transfer.\r\nProvides proper alignment - Balances foot impact areas. Can reduce fatigue and increase life of footwear. \r\nLow Flanges - Fits in most shoes. Helps to relieve pressure in bunion area.\r\nHeel Cup - Narrower heel cup than BirkoBalance. Cushions protect heel bone. Can relieve pain symptoms. Provides natural cushioning and shock absorption.'),(117,10,97,0,2450,'A two-piece system that offers support and cushioning. On the bottom is a 3/4-length arch support made from natural cork/EVA. The full length blue innersole is made from EVA foam (BirkoCell) that fits inside the arch support to absorb shock and provide addional support.\r\n\r\nArch Flexible lightweight support. Heel Cup stabilizes and supports foot.  Contoured arches support instep and ball of foot; distributes impact. Toe bar exercises feet and leg muscles. Metatarsal build up provides extra cushioning under the ball of the foot.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (118,10,97,0,2451,'Breathable full-length footbed insole is anatomically shaped with a shock-absorbing, flexible forefoot area, and relieves foot strain from high-impact sports. It features a deep heel cup, moderate longitudinal (medial and lateral) arches and moderate metatarsal support. \r\nProvides proper alignment. Flexible to support lateral movement. Balances foot impact areas. Reduces fatigue. Can increase life of footwear. Supports instep and ball of foot.  Protects heel bone. Can relieve heel pain symptoms. Provides natural cushioning and shock absorption.  Hypoallergenic. Absorbs moisture and keeps feet dry.'),(119,10,97,0,2452,'Super Birki Clog - Replacement Cork Footbed'),(120,10,97,0,2453,'Replacement Cork Footbed for Outdoor Birki Clogs'),(121,10,97,0,2454,'A cross-strap, toe loop sandal with an adjustable strap in silky suede with a shock absorbing EVA sole. Available in narrow and regular widths.'),(122,10,97,0,2455,'In a beautiful cocoa nubuck leather, three straps keep you secure yet allow the convenience of a slip-on.  Top grain cowhide has been buffed to create a soft velvety finish.  This sandal has fully adjustable straps and shock-absorbing EVA sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(123,10,97,0,2456,'In a buttery smooth black leather, three straps keep you secure yet allow the convenience of a slip-on. This sandal has fully adjustable straps and shock-absorbing EVA sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (124,10,97,0,2457,'In a gorgeous bordeaux leather, three straps keep you secure yet allow the convenience of a slip-on.  This sandal has fully adjustable straps and shock-absorbing EVA sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(125,10,97,0,2458,'Ah, Florida!  Three straps to keep you secure, yet the convenience of a slide-on. This sandal has fully adjustable straps, shock-absorbing EVA sole, and features Birkenstock\'s classic suede-lined cork/latex footbed.'),(126,10,97,0,2459,'In a beautiful cocoa nubuck leather, three straps keep you secure yet allow the convenience of a slip-on.  Top grain cowhide has been buffed to create a soft velvety finish.  This sandal has fully adjustable straps and shock-absorbing EVA sole. Features Birkenstock\'s special suede-lined cork/latex footbed with a high arch support for those individuals who require it.'),(127,10,97,0,2460,'The perfect sexy thong sandal for hot summer days! Gizeh gives you great arch support while cooling your heels ... and toes.  Has a fully adjustable vamp strap and shock-absorbing EVA sole.');
