insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (132,10,97,0,2465,'The perfect flirty summer sandal, giving you Birkenstock support that feels almost like going barefoot!  The more you wear them, the better they fit!  Two adjustable straps are placed low over the toes on a classic contoured cork footbed for comfort.'),(133,10,97,0,2466,'The perfect flirty summer sandal, giving you Birkenstock support that feels almost like going barefoot!  The more you wear them, the better they fit!  Two adjustable straps are placed low over the toes on a classic contoured cork footbed for comfort.'),(134,10,97,0,2467,'The perfect flirty summer sandal, giving you Birkenstock support that feels almost like going barefoot!  The more you wear them, the better they fit!  Two adjustable straps are placed low over the toes on a classic contoured cork footbed for comfort.'),(135,10,97,0,2468,'Find out what everyone is raving about. No smoke, no mirrors, and no gizmos are needed. The comfort and support of these classic Birkenstock sandals are unparalleled. In carefree Birko-Flor, the Milano features Birkenstock\'s super comfy contoured suede-lined cork footbed, adjustable leather back and vamp straps, and a shock-absorbing EVA outsole.  Step into bliss!');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (136,10,97,0,2469,'Find out what everyone is raving about. No smoke, no mirrors, and no gizmos are needed. The comfort and support of these classic Birkenstock sandals are unparalleled. In carefree Birko-Flor, the Milano features Birkenstock\'s super comfy contoured suede-lined cork footbed, adjustable leather back and vamp straps, and a shock-absorbing EVA outsole.  Step into bliss!'),(137,10,97,0,2470,'Find out what everyone is raving about. No smoke, no mirrors, and no gizmos are needed. The comfort and support of these classic Birkenstock sandals are unparalleled. In smooth black leather, the Milano features Birkenstock\'s super comfy contoured suede-lined cork footbed, adjustable leather back and vamp straps, and a shock-absorbing EVA outsole.  Step into bliss!'),(138,10,97,0,2471,'A classic returns! If you missed this traditional Birkenstock style, you might want to buy more than one pair. Front adjustable strap with full wrap ankle strap sandal with the contoured cork/EVA footbed. Completely repairable and resoleable.'),(139,10,97,0,2472,'A classic returns! If you missed this traditional Birkenstock style, you might want to buy more than one pair. Front adjustable strap with full wrap ankle strap sandal with the contoured cork/EVA footbed. Completely repairable and resoleable.'),(140,10,97,0,2473,'Wide-strap sandal in various materials with adjustable strap and shock-absorbing EVA sole.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (141,10,97,0,2474,'A cross-strap, toe loop sandal with an adjustable strap in silky suede with a shock absorbing EVA sole. Available in narrow and regular widths.'),(142,10,97,0,2475,'A cross-strap, toe loop sandal with an adjustable strap in silky suede with a shock absorbing EVA sole. Available in narrow and regular widths.'),(143,10,97,0,2476,'Classic clog in smooth black leather.  Has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(144,10,97,0,2477,'Classic clog in smooth dark brown leather has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(145,10,97,0,2478,'Classic clog in a variety of materials with adjustable strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed. Some colors and materials available with a soft footbed, a high arch or in kids\' sizes.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (146,10,97,0,2479,'Classic clog in rustic antique peat leather.  The suface is smooth but with a flat finish.  Has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(147,10,97,0,2480,'Classic Boston clog in white leather has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(148,10,97,0,2481,'Classic clog in soft black suede has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed. This color is available with a soft footbed.'),(149,10,97,0,2482,'Classic clog in luscious mocha suede with an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed. This color also available with a soft footbed.'),(150,10,97,0,2483,'Classic clog in soft and comfy taupe suede.  Has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed. This color is also available with a Soft Footbed or a High Arch.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (151,10,97,0,2484,'Classic clog in a soft taupe suede with an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s suede-lined cork/latex footbed with a high arch.'),(152,10,97,0,2485,'The Classic clog in yummy mocha suede with a stylishly thin, smooth leather strap with buckle across the vamp.  Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(153,10,97,0,2486,'The Classic clog in soft taupe suede with a stylishly thin, smooth leather strap with buckle across the vamp.  Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(154,10,97,0,2487,'Completely enclosed leather shoe with cut out details on each side of the vamp.  Has fully adjustable strap, the classic Birkenstock suede lined footbed and shock-absorbing EVA sole. Also available with an Anti-Slip Sole featuring extra durable slip resistant tread, as well as with Electrostatic Dissipative qualities. Birkenstock ESD products meet current industry standard requirements.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (155,10,97,0,2488,'Completely enclosed leather shoe with cut out details on each side of the vamp.  Has fully adjustable strap, the classic Birkenstock suede lined footbed and shock-absorbing EVA sole. Also available with an Anti-Slip Sole featuring extra durable slip resistant tread, as well as with Electrostatic Dissipative qualities. Birkenstock ESD products meet current industry standard requirements.'),(156,10,97,0,2489,'Backstrap smooth leather clog with fully adjustable straps, classic suede-lined cork/latex footbed, shock absorbing EVA sole. Also available with special anti-slip two-layer EVA and rubber sole combination allowing for better traction on slippery surfaces. Also available with ESD (electrostatic dissipative) qualities, featuring three rivots to dissipate shock and special ESD soling material. Birkenstock ESD products test and measure within current ESD standard requirements.'),(157,10,97,0,2490,'Set of Three -\r\n\r\nBlack / Stone-Blue -\r\nGrey / Purple-White - \r\nBlack / Pink-Black - (Womens sizes 5-10)\r\n 37% Modal, 16% ANgora, 12% Wool, 33% Nylon, 2% Elastane'),(158,10,97,0,2491,'Thin durable socks that come above your ankles for additional warmth. Slightly thinner-feeling socks come in beautiful soft colors. Made of a 70% bamboo and 30% nylon blend for durability, strength and softness.\r\nSet of three - Bamboo Crew Socks -  Cameo Rose / Chocolate Brown / Creme - (Womens sizes 5-10)');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (159,10,97,0,2492,'Set of three - Lambswool Bowtie Socks - Moss / Black / Red - (Womens Sizes 5-10) - 73%Wool, 18% Nylon, 7% Polyester, 2% Spandex'),(160,10,97,0,2493,'Thin durable socks that come above your ankles for additional warmth. Slightly thinner-feeling socks come in beautiful soft colors. Made of a 70% bamboo and 30% nylon blend for durability, strength and softness.  Women\'s size 1 (5-10).  Men\'s size 1 (5-8).'),(161,10,97,0,2494,'Thin durable socks that come above your ankles for additional warmth. Slightly thinner-feeling socks come in beautiful soft colors. Made of a 70% bamboo and 30% nylon blend for durability, strength and softness.  Women\'s size 1 (5-10).  Men\'s size 1 (5-8).'),(162,10,97,0,2495,'You\'ll love the quality and softness of the only socks found good enough to bear the Birkenstock name!  These year-round socks are exclusively designed to look and feel great with Birkenstock footwear.  44% fine merino wool, 36% nylon, 19% cashmere, 1% Lycra spandex.  Women\'s size 1 (5-10)');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (163,10,97,0,2496,'Soft on your feet, easy on the environment, our Eco Friendly Boot Socks are made with 48% Ecospun fiber, which is spun from recycled plastic bottles, then blended with 50% cotton and 2% spandex, producing a soft, durable boot sock.  These earth-friendly socks look great, feel even better and they\'re helping to keep our earth healthy!'),(164,10,97,0,2497,'Our classic quality socks made with 72% Wool. 19% Nylon, 7% spandex a blend with softness and comfort for the cooler seasons.'),(165,10,97,0,2498,'Thin durable socks that come above your ankles for additional warmth. Slightly thinner-feeling socks come in beautiful soft colors. Made of a 70% bamboo and 30% nylon blend for durability, strength and softness.  Women\'s size 1 (5-10).  Men\'s size 1 (5-8).'),(166,10,97,0,2499,'Thin durable socks that come above your ankles for additional warmth. Slightly thinner-feeling socks come in beautiful soft colors. Made of a 70% bamboo and 30% nylon blend for durability, strength and softness.  Women\'s size 1 (5-10), 2 (10-13).  Men\'s size 1 (5-8), 2 (10-13).');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (167,10,97,0,2500,'You\'ll love the quality and softness of the only socks found good enough to bear the Birkenstock name!  These year-round socks are exclusively designed to look and feel great with Birkenstock footwear.  44% fine merino wool, 36% nylon, 19% cashmere, 1% Lycra spandex.  Women\'s size 1 (5-10), 2 (10-13).  Men\'s size 1 (5-8), 2 (8-12).'),(659,10,97,0,2444,'The A604 from Alpro is a Steel Toe Polyurethane Clog with a removable, replaceable cork footbed. The sole has a deeper tread for improved traction and the Steel Toe passed ANSI Z 41 1999 standards for Class I/75 impact and Class C/75 compression classification.'),(729,10,97,1,2400,'Moccasin stitch lace up, removable cork/latex and hand-stitched Smartlite sole.'),(730,10,97,1,2401,'The Ponte Sor is sleek, black, and totally street. With leather uppers, a removable footbed providing arch and metatarsal support, and flexible rubber soles, the Ponte Sor offers athletic style (with four suede \"racing\" stripes and a red mesh tongue for a hint of contrast) with a casual fit.'),(731,10,97,1,2402,'A men\'s sporty, lace-up sneaker.  Has Footprints removable and anatomically contoured footbed.  Suede upper is breathable, durable and comfortable.  Take a step into comfort you won\'t forget!');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (732,10,97,1,2403,'A men\'s sporty, lace-up sneaker.  Has Footprints removable and anatomically contoured footbed.  Suede upper is breathable, durable and comfortable.  Take a step into comfort you won\'t forget!'),(733,10,97,1,2404,'A men\'s sporty, lace-up sneaker with a removable contoured footbed.'),(734,10,97,1,2405,'An almost-Mary-Jane style shoe with added foot coverage up to the adjustable buckle strap. Subtle, fashionable leather imprints decorate the toe box, and it comes with a removable contoured footbed.'),(735,10,97,1,2406,'Simple yet elegant loafer in smooth leather with zig-zag stitched top seam and stretch vents for easy on/off. Includes removable cork/latex footbed, side-panel goring and new shock-absorbing polyurethane/rubber sole.'),(736,10,97,1,2407,'Moccasin-style loafer goes in and out of the office. Includes removable cork/latex footbed and new shock absorbing polyurethane/rubber sole.'),(737,10,97,1,2408,'A sleek and feminine loafer for in and out of the office. Includes removable cork/latex footbed and a shock absorbing polyurethane sole.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (738,10,97,1,2409,'Sporty, sleek and urban. This ladies\' slip-on shoe with an adjustable top strap is made for comfort on the go. Includes a removable contoured footbed and a metal shank for added stability. Two widths, light PU-sole.'),(739,10,97,1,2410,'A slick and stylish women\'s sport shoe in rosewood leather.  Top stitching adds interest.  Has a removable cork/latex footbed and a shock absorbing low profile rubber sole.'),(740,10,97,1,2411,'A slick and stylish women\'s sport shoe in deep navy suede.  Top stitching adds interest.  Has a removable cork/latex footbed and a shock absorbing low profile rubber sole.'),(741,10,97,1,2412,'A womens sports shoe / sneaker in Sage Suede with lime yellow accent stripes- Footbed removable cork/latex footbed and a shock absorbing rubber sole.'),(742,10,97,1,2413,'Lace up dress shoes with smooth leather upper, removable cork/latex footbed, a combination leather/rubber sole, and a metal shank for added stability.'),(743,10,97,1,2414,'Ease and comfort are the bywords for this Mary-Jane style shoe in smooth black leather.  Has an adjustable velcro-closure strap, a removable contoured footbed, and a metal shank for added stability.');
