insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (750,10,97,1,2421,'A ladies\' sporty lace-up oxford with a slimmer sole for a sleek look.  Has a removable contoured footbed, while the padded tongue and collar add extra comfort on a low profile outsole.  Also has a metal shank for added stability.'),(751,10,97,1,2422,'A sleek and feminine loafer for in and out of the office. Includes removable contoured cork/latex footbed and a shock absorbing polyurethane sole.'),(752,10,97,1,2423,'Women\'s sport shoe in grey suede with removable cork/latex footbed and a shock absorbing rubber sole.'),(753,10,97,1,2424,'A womens sports shoe / sneaker in Blue Suede with paler blue accent stripes- Removable cork/latex footbed and a shock absorbing rubber sole.'),(754,10,97,1,2425,'An almost-Mary-Jane style shoe with added foot coverage up to the adjustable buckle strap. Subtle, fashionable leather imprints decorate the toe box, and it comes with a removable contoured footbed.'),(755,10,97,1,2426,'A ladies\' sporty lace-up oxford with a slimmer sole for a sleek look.  Has a removable contoured footbed, while the padded tongue and collar add extra comfort on a low profile outsole.  Also has a metal shank for added stability.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (756,10,97,1,2427,'Sporty, sleek and urban. This ladies\' slip-on shoe with an adjustable top strap is made for comfort on the go. Includes a removable contoured footbed and a metal shank for added stability. Two widths, light PU-sole'),(757,10,97,1,2428,'A slick and stylish women\'s sport shoe in rich brown suede.  Top stitching adds interest.  Has a removable cork/latex footbed and a shock absorbing low profile rubber sole.'),(758,10,97,1,2429,'An urban twist on classic styling. This Mary Jane style is adjustable and has a metal shank for added stability. We offer the Scarlet lined with cambrelle for its wicking and antimicrobial benefits and the black with traditional pigskin. Built on our fluid outsole.'),(759,10,97,1,2430,'A casual slip on with contrasting stitching and double goring for adjustability. Also has a hidden internal collar padding, metal shank for added stability, and fluid outsole. Lined with cambrelle for wicking and antimicrobial benefits.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (760,10,97,1,2431,'An elegant suede ankle-length boot for the discriminating taste.  Lined with Carnival, a Synthetic Liner that allows the feet to breath while providing warmth and wicking ability. Outsoul is made of dense, rugged rubber tread for excellent traction, gripping and long wear. Removable Natural Cork/Latex footbed.'),(761,10,97,1,2432,'Enjoy your walk and let Footprints take care of your feet with this casual light hiker, great for day hikes on the trail or around town. Removable cork/latex footbed, rust-proof eyelets and oxford lacing. Features dense rubber tread to ensure excellent traction and long wear, and a synthetic shank made of Bergamid nylon for added stability.'),(762,10,97,1,2433,'Enjoy your walk and let Footprints take care of your feet with this casual light hiker, great for day hikes on the trail or around town. Removable cork/latex footbed, rust-proof eyelets and oxford lacing. Features dense rubber tread to ensure excellent traction and long wear, and a synthetic shank made of Bergamid nylon for added stability.'),(763,10,97,1,2434,'Rugged ankle-high hiking boot with removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, a dense rubber tread to ensure excellent traction and long wear, and a synthetic shank for added stability. The synthetic shank is made of Bergamid, a type of nylon.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (764,10,97,1,2435,'Rugged ankle-high hiking boot with removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, a dense rubber tread to ensure excellent traction and long wear, and a synthetic shank for added stability. The synthetic shank is made of Bergamid, a type of nylon.'),(765,10,97,1,2436,'Rugged and waterproof high-top hiking boot for maximum ankle support. Features removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, and dense rubber tread to ensure excellent traction and long wear. Made with Sympatex, a waterproof, breathable material that keeps feet dry while allowing moisture from perspiration to pass through. Also has a metal shank for added stability.'),(766,10,97,1,2437,'Rugged and waterproof high-top hiking boot for maximum ankle support. Features removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, and dense rubber tread to ensure excellent traction and long wear. Made with Sympatex, a waterproof, breathable material that keeps feet dry while allowing moisture from perspiration to pass through. Also has a metal shank for added stability.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (767,10,97,1,2438,'Rugged and waterproof high-top hiking boot for maximum ankle support. Features removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, and dense rubber tread to ensure excellent traction and long wear. Made with Sympatex, a waterproof, breathable material that keeps feet dry while allowing moisture from perspiration to pass through. Also has a synthetic shank for added stability, made of Bergamid, a type of nylon.'),(768,10,97,1,2439,'Rugged and waterproof high-top hiking boot for maximum ankle support. Features removable cork/latex footbed, half-gussetted tongue, rustproof eyelets, and dense rubber tread to ensure excellent traction and long wear. Made with Sympatex, a waterproof, breathable material that keeps feet dry while allowing moisture from perspiration to pass through. Also has a synthetic shank for added stability, made of Bergamid, a type of nylon.'),(769,10,97,1,2440,'Euro-style professional shoe with a flexible cork/latex footbed and shock-absorbing sole. Polyurethane coated leather uppers are heat, cold, acid and chemical resistant. Velcro closures provide a custom fit.'),(770,10,97,1,2441,'Euro-style professional shoe with a flexible cork/latex footbed and shock-absorbing sole. Polyurethane coated leather uppers are heat, cold, acid and chemical resistant. Velcro closures provide a custom fit.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (771,10,97,1,2442,'Professional clog with adjustable back and vamp straps on a sporty, polyurethane sole with deeper tread for improved traction. This clog offers a heel pad in the footbed and upper leather is coated with polyurethane to provide heat, cold, acid and chemical resistance.'),(772,10,97,1,2443,'Professional clog with adjustable back and vamp straps on a sporty, polyurethane sole with deeper tread for improved traction. This clog offers a heel pad in the footbed and upper leather is coated with polyurethane to provide heat, cold, acid and chemical resistance.'),(773,10,97,1,2445,'The A604 from Alpro is a Steel Toe Polyurethane Clog with a removable, replaceable cork footbed. The sole has a deeper tread for improved traction and the Steel Toe passed ANSI Z 41 1999 standards for Class I/75 impact and Class C/75 compression classification.'),(774,10,97,1,2446,'Our most popular style, providing long term comfort and arch support to any casual, flat footwear. Contoured arches and deep heel cup can help relieve heel pain and plantar fasciitis symptoms. Like the Heeled Blue Footbed, it has a silk lining that absorbs moisture and is hand-washable. Casual Blue Footbed is available in narrow, medium and wide widths. \r\nCasual - For flat/low heeled footwear.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (775,10,97,1,2447,'A popular style that provides long term comfort and arch support to any heeled footwear (up to 1\" heels). Contoured arches and deep heel cup can help relieve heel pain and plantar fasciitis symptoms. Similar to the Casual Blue Footbed, this heeled version has silk lining that absorbs moisture and is hand-washable. Heeled Blue Footbed is available in narrow, medium and wide widths. \r\nHeeled - For heeled footwear up to 1\".'),(776,10,97,1,2448,'Arch support with natural cork and EVA. It features a deep molded heel cup, pronounced medial arch support and moderate metatarsal support.\r\n\r\nSupports the medial arch - Can help with problems such as fallen arches and over-pronation.\r\nSupports the ball of the foot - Helps maintain the natural curvature necessary for optimal weight-bearing and transfer.\r\nProvides proper alignment - Balances foot impact areas. Can reduce fatigue and increase life of footwear. \r\nHigh Flanges - Increases stability. Helps control excessive pronation and/or supination.\r\nDeep Heel Cup - Cushions and protects the heel bone. Can relieve heel pain symptoms. Provides natural cushioning and shock absorption.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (777,10,97,1,2449,'Arch support with natural cork and EVA. It features a deep molded heel cup, pronounced medial arch support and moderate metatarsal support.\r\nSupports the medial arch - Can help with problems such as fallen arches and over-pronation.\r\nSupports the ball of the foot - Helps maintain the natural curvature necessary for optimal weight-bearing and transfer.\r\nProvides proper alignment - Balances foot impact areas. Can reduce fatigue and increase life of footwear. \r\nLow Flanges - Fits in most shoes. Helps to relieve pressure in bunion area.\r\nHeel Cup - Narrower heel cup than BirkoBalance. Cushions protect heel bone. Can relieve pain symptoms. Provides natural cushioning and shock absorption.'),(778,10,97,1,2450,'A two-piece system that offers support and cushioning. On the bottom is a 3/4-length arch support made from natural cork/EVA. The full length blue innersole is made from EVA foam (BirkoCell) that fits inside the arch support to absorb shock and provide addional support.\r\n\r\nArch Flexible lightweight support. Heel Cup stabilizes and supports foot.  Contoured arches support instep and ball of foot; distributes impact. Toe bar exercises feet and leg muscles. Metatarsal build up provides extra cushioning under the ball of the foot.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (779,10,97,1,2451,'Breathable full-length footbed insole is anatomically shaped with a shock-absorbing, flexible forefoot area, and relieves foot strain from high-impact sports. It features a deep heel cup, moderate longitudinal (medial and lateral) arches and moderate metatarsal support. \r\nProvides proper alignment. Flexible to support lateral movement. Balances foot impact areas. Reduces fatigue. Can increase life of footwear. Supports instep and ball of foot.  Protects heel bone. Can relieve heel pain symptoms. Provides natural cushioning and shock absorption.  Hypoallergenic. Absorbs moisture and keeps feet dry.'),(780,10,97,1,2452,'Super Birki Clog - Replacement Cork Footbed'),(781,10,97,1,2453,'Replacement Cork Footbed for Outdoor Birki Clogs'),(782,10,97,1,2454,'A cross-strap, toe loop sandal with an adjustable strap in silky suede with a shock absorbing EVA sole. Available in narrow and regular widths.'),(783,10,97,1,2455,'In a beautiful cocoa nubuck leather, three straps keep you secure yet allow the convenience of a slip-on.  Top grain cowhide has been buffed to create a soft velvety finish.  This sandal has fully adjustable straps and shock-absorbing EVA sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(784,10,97,1,2456,'In a buttery smooth black leather, three straps keep you secure yet allow the convenience of a slip-on. This sandal has fully adjustable straps and shock-absorbing EVA sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (785,10,97,1,2457,'In a gorgeous bordeaux leather, three straps keep you secure yet allow the convenience of a slip-on.  This sandal has fully adjustable straps and shock-absorbing EVA sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(786,10,97,1,2458,'Ah, Florida!  Three straps to keep you secure, yet the convenience of a slide-on. This sandal has fully adjustable straps, shock-absorbing EVA sole, and features Birkenstock\'s classic suede-lined cork/latex footbed.'),(787,10,97,1,2459,'In a beautiful cocoa nubuck leather, three straps keep you secure yet allow the convenience of a slip-on.  Top grain cowhide has been buffed to create a soft velvety finish.  This sandal has fully adjustable straps and shock-absorbing EVA sole. Features Birkenstock\'s special suede-lined cork/latex footbed with a high arch support for those individuals who require it.'),(788,10,97,1,2460,'The perfect sexy thong sandal for hot summer days! Gizeh gives you great arch support while cooling your heels ... and toes.  Has a fully adjustable vamp strap and shock-absorbing EVA sole.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (789,10,97,1,2461,'The perfect sexy thong sandal for hot summer days! Gizeh gives you great arch support while cooling your heels ... and toes.  Has a fully adjustable vamp strap and shock-absorbing EVA sole.'),(790,10,97,1,2462,'A feminine cutout pattern on the double straps gives this sandal a dressier look. The straps fit lower on the foot, making it a great way to exercise your feet and legs while looking great!  Has two fully adjustable straps and shock-absorbing EVA sole.'),(791,10,97,1,2463,'A feminine cutout pattern on the double straps gives this sandal a dressier look. The straps fit lower on the foot, making it a great way to exercise your feet and legs while looking great!  Has two fully adjustable straps and shock-absorbing EVA sole.'),(792,10,97,1,2464,'A feminine cutout pattern on the double straps gives this sandal a dressier look. The straps fit lower on the foot, making it a great way to exercise your feet and legs while looking great!  Has two fully adjustable straps and shock-absorbing EVA sole.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (793,10,97,1,2465,'The perfect flirty summer sandal, giving you Birkenstock support that feels almost like going barefoot!  The more you wear them, the better they fit!  Two adjustable straps are placed low over the toes on a classic contoured cork footbed for comfort.'),(794,10,97,1,2466,'The perfect flirty summer sandal, giving you Birkenstock support that feels almost like going barefoot!  The more you wear them, the better they fit!  Two adjustable straps are placed low over the toes on a classic contoured cork footbed for comfort.'),(795,10,97,1,2467,'The perfect flirty summer sandal, giving you Birkenstock support that feels almost like going barefoot!  The more you wear them, the better they fit!  Two adjustable straps are placed low over the toes on a classic contoured cork footbed for comfort.'),(796,10,97,1,2468,'Find out what everyone is raving about. No smoke, no mirrors, and no gizmos are needed. The comfort and support of these classic Birkenstock sandals are unparalleled. In carefree Birko-Flor, the Milano features Birkenstock\'s super comfy contoured suede-lined cork footbed, adjustable leather back and vamp straps, and a shock-absorbing EVA outsole.  Step into bliss!');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (797,10,97,1,2469,'Find out what everyone is raving about. No smoke, no mirrors, and no gizmos are needed. The comfort and support of these classic Birkenstock sandals are unparalleled. In carefree Birko-Flor, the Milano features Birkenstock\'s super comfy contoured suede-lined cork footbed, adjustable leather back and vamp straps, and a shock-absorbing EVA outsole.  Step into bliss!'),(798,10,97,1,2470,'Find out what everyone is raving about. No smoke, no mirrors, and no gizmos are needed. The comfort and support of these classic Birkenstock sandals are unparalleled. In smooth black leather, the Milano features Birkenstock\'s super comfy contoured suede-lined cork footbed, adjustable leather back and vamp straps, and a shock-absorbing EVA outsole.  Step into bliss!'),(799,10,97,1,2471,'A classic returns! If you missed this traditional Birkenstock style, you might want to buy more than one pair. Front adjustable strap with full wrap ankle strap sandal with the contoured cork/EVA footbed. Completely repairable and resoleable.'),(800,10,97,1,2472,'A classic returns! If you missed this traditional Birkenstock style, you might want to buy more than one pair. Front adjustable strap with full wrap ankle strap sandal with the contoured cork/EVA footbed. Completely repairable and resoleable.'),(801,10,97,1,2473,'Wide-strap sandal in various materials with adjustable strap and shock-absorbing EVA sole.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (802,10,97,1,2474,'A cross-strap, toe loop sandal with an adjustable strap in silky suede with a shock absorbing EVA sole. Available in narrow and regular widths.'),(803,10,97,1,2475,'A cross-strap, toe loop sandal with an adjustable strap in silky suede with a shock absorbing EVA sole. Available in narrow and regular widths.'),(804,10,97,1,2476,'Classic clog in smooth black leather.  Has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(805,10,97,1,2477,'Classic clog in smooth dark brown leather has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(806,10,97,1,2478,'Classic clog in a variety of materials with adjustable strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed. Some colors and materials available with a soft footbed, a high arch or in kids\' sizes.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (807,10,97,1,2479,'Classic clog in rustic antique peat leather.  The suface is smooth but with a flat finish.  Has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(808,10,97,1,2480,'Classic Boston clog in white leather has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(809,10,97,1,2481,'Classic clog in soft black suede has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed. This color is available with a soft footbed.'),(810,10,97,1,2482,'Classic clog in luscious mocha suede with an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed. This color also available with a soft footbed.'),(811,10,97,1,2483,'Classic clog in soft and comfy taupe suede.  Has an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s classic suede-lined cork/latex footbed. This color is also available with a Soft Footbed or a High Arch.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (812,10,97,1,2484,'Classic clog in a soft taupe suede with an adjustable vamp strap and shock-absorbing EVA outer sole. Features Birkenstock\'s suede-lined cork/latex footbed with a high arch.'),(813,10,97,1,2485,'The Classic clog in yummy mocha suede with a stylishly thin, smooth leather strap with buckle across the vamp.  Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(814,10,97,1,2486,'The Classic clog in soft taupe suede with a stylishly thin, smooth leather strap with buckle across the vamp.  Features Birkenstock\'s classic suede-lined cork/latex footbed.'),(815,10,97,1,2487,'Completely enclosed leather shoe with cut out details on each side of the vamp.  Has fully adjustable strap, the classic Birkenstock suede lined footbed and shock-absorbing EVA sole. Also available with an Anti-Slip Sole featuring extra durable slip resistant tread, as well as with Electrostatic Dissipative qualities. Birkenstock ESD products meet current industry standard requirements.');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (816,10,97,1,2488,'Completely enclosed leather shoe with cut out details on each side of the vamp.  Has fully adjustable strap, the classic Birkenstock suede lined footbed and shock-absorbing EVA sole. Also available with an Anti-Slip Sole featuring extra durable slip resistant tread, as well as with Electrostatic Dissipative qualities. Birkenstock ESD products meet current industry standard requirements.'),(817,10,97,1,2489,'Backstrap smooth leather clog with fully adjustable straps, classic suede-lined cork/latex footbed, shock absorbing EVA sole. Also available with special anti-slip two-layer EVA and rubber sole combination allowing for better traction on slippery surfaces. Also available with ESD (electrostatic dissipative) qualities, featuring three rivots to dissipate shock and special ESD soling material. Birkenstock ESD products test and measure within current ESD standard requirements.'),(818,10,97,1,2490,'Set of Three -\r\n\r\nBlack / Stone-Blue -\r\nGrey / Purple-White - \r\nBlack / Pink-Black - (Womens sizes 5-10)\r\n 37% Modal, 16% ANgora, 12% Wool, 33% Nylon, 2% Elastane'),(819,10,97,1,2491,'Thin durable socks that come above your ankles for additional warmth. Slightly thinner-feeling socks come in beautiful soft colors. Made of a 70% bamboo and 30% nylon blend for durability, strength and softness.\r\nSet of three - Bamboo Crew Socks -  Cameo Rose / Chocolate Brown / Creme - (Womens sizes 5-10)');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (820,10,97,1,2492,'Set of three - Lambswool Bowtie Socks - Moss / Black / Red - (Womens Sizes 5-10) - 73%Wool, 18% Nylon, 7% Polyester, 2% Spandex'),(821,10,97,1,2493,'Thin durable socks that come above your ankles for additional warmth. Slightly thinner-feeling socks come in beautiful soft colors. Made of a 70% bamboo and 30% nylon blend for durability, strength and softness.  Women\'s size 1 (5-10).  Men\'s size 1 (5-8).'),(822,10,97,1,2494,'Thin durable socks that come above your ankles for additional warmth. Slightly thinner-feeling socks come in beautiful soft colors. Made of a 70% bamboo and 30% nylon blend for durability, strength and softness.  Women\'s size 1 (5-10).  Men\'s size 1 (5-8).'),(823,10,97,1,2495,'You\'ll love the quality and softness of the only socks found good enough to bear the Birkenstock name!  These year-round socks are exclusively designed to look and feel great with Birkenstock footwear.  44% fine merino wool, 36% nylon, 19% cashmere, 1% Lycra spandex.  Women\'s size 1 (5-10)');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (824,10,97,1,2496,'Soft on your feet, easy on the environment, our Eco Friendly Boot Socks are made with 48% Ecospun fiber, which is spun from recycled plastic bottles, then blended with 50% cotton and 2% spandex, producing a soft, durable boot sock.  These earth-friendly socks look great, feel even better and they\'re helping to keep our earth healthy!'),(825,10,97,1,2497,'Our classic quality socks made with 72% Wool. 19% Nylon, 7% spandex a blend with softness and comfort for the cooler seasons.'),(826,10,97,1,2498,'Thin durable socks that come above your ankles for additional warmth. Slightly thinner-feeling socks come in beautiful soft colors. Made of a 70% bamboo and 30% nylon blend for durability, strength and softness.  Women\'s size 1 (5-10).  Men\'s size 1 (5-8).'),(827,10,97,1,2499,'Thin durable socks that come above your ankles for additional warmth. Slightly thinner-feeling socks come in beautiful soft colors. Made of a 70% bamboo and 30% nylon blend for durability, strength and softness.  Women\'s size 1 (5-10), 2 (10-13).  Men\'s size 1 (5-8), 2 (10-13).');
insert into `catalog_product_entity_text` (`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (828,10,97,1,2500,'You\'ll love the quality and softness of the only socks found good enough to bear the Birkenstock name!  These year-round socks are exclusively designed to look and feel great with Birkenstock footwear.  44% fine merino wool, 36% nylon, 19% cashmere, 1% Lycra spandex.  Women\'s size 1 (5-10), 2 (10-13).  Men\'s size 1 (5-8), 2 (8-12).'),(928,10,97,1,2444,'The A604 from Alpro is a Steel Toe Polyurethane Clog with a removable, replaceable cork footbed. The sole has a deeper tread for improved traction and the Steel Toe passed ANSI Z 41 1999 standards for Class I/75 impact and Class C/75 compression classification.');

/*Table structure for table `catalog_product_entity_tier_price` */

DROP TABLE IF EXISTS `catalog_product_entity_tier_price`;

CREATE TABLE `catalog_product_entity_tier_price` (
  `value_id` int(11) NOT NULL auto_increment,
  `entity_type_id` mediumint(8) unsigned NOT NULL default '0',
  `attribute_id` smallint(5) unsigned NOT NULL default '0',
  `store_id` smallint(5) unsigned NOT NULL default '0',
  `entity_id` int(10) unsigned NOT NULL default '0',
  `qty` smallint(5) unsigned NOT NULL default '1',
  `value` decimal(12,4) NOT NULL default '0.0000',
  PRIMARY KEY  (`value_id`),
  KEY `FK_CATALOG_PRODUCT_ENTITY_TIER_PRICE_ATTRIBUTE` (`attribute_id`),
  KEY `FK_CATALOG_PRODUCT_ENTITY_TIER_PRICE_STORE` (`store_id`),
  KEY `FK_CATALOG_PRODUCT_ENTITY_TIER_PRICE_PRODUCT_ENTITY` (`entity_id`),
  CONSTRAINT `FK_CATALOG_PRODUCT_ENTITY_TIER_PRICE_PRODUCT_ENTITY` FOREIGN KEY (`entity_id`) REFERENCES `catalog_product_entity` (`entity_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_CATALOG_PRODUCT_ENTITY_TIER_PRICE_ATTRIBUTE` FOREIGN KEY (`attribute_id`) REFERENCES `eav_attribute` (`attribute_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_CATALOG_PRODUCT_ENTITY_TIER_PRICE_STORE` FOREIGN KEY (`store_id`) REFERENCES `core_store` (`store_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `catalog_product_entity_tier_price` */

/*Table structure for table `catalog_product_entity_varchar` */

DROP TABLE IF EXISTS `catalog_product_entity_varchar`;

CREATE TABLE `catalog_product_entity_varchar` (
  `value_id` int(11) NOT NULL auto_increment,
  `entity_type_id` mediumint(8) unsigned NOT NULL default '0',
  `attribute_id` smallint(5) unsigned NOT NULL default '0',
  `store_id` smallint(5) unsigned NOT NULL default '0',
  `entity_id` int(10) unsigned NOT NULL default '0',
  `value` varchar(255) NOT NULL default '',
  PRIMARY KEY  (`value_id`),
  KEY `FK_CATALOG_PRODUCT_ENTITY_VARCHAR_ATTRIBUTE` (`attribute_id`),
  KEY `FK_CATALOG_PRODUCT_ENTITY_VARCHAR_STORE` (`store_id`),
  KEY `FK_CATALOG_PRODUCT_ENTITY_VARCHAR_PRODUCT_ENTITY` (`entity_id`),
  CONSTRAINT `FK_CATALOG_PRODUCT_ENTITY_VARCHAR_PRODUCT_ENTITY` FOREIGN KEY (`entity_id`) REFERENCES `catalog_product_entity` (`entity_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_CATALOG_PRODUCT_ENTITY_VARCHAR_ATTRIBUTE` FOREIGN KEY (`attribute_id`) REFERENCES `eav_attribute` (`attribute_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_CATALOG_PRODUCT_ENTITY_VARCHAR_STORE` FOREIGN KEY (`store_id`) REFERENCES `core_store` (`store_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `catalog_product_entity_varchar` */

